const initialState = {
    days: [
        {
            id: "0",
            categories: [
                {
                    id: "test",
                    cells: ["test"]
                }
            ]
        }
    ],
    cells: {
        "test": {
            category: "test",
            days: ["0"]
        }
    }
}

export default function cellReducer(state = initialState, action) {
    switch(action.type) {
        case ADD_CELL: {
            const { payload } = action
            const { dayId, categoryName, cellName } = payload
            return {
                ...state,
                days: {
                    ...state?.days,
                    [dayId]: {
                        ...state?.days[dayId],
                        categories: {
                            ...state?.days[dayId]?.categories,
                            [categoryName]: {
                                ...state?.days[dayId]?.categories[categoryName],
                                cells: [
                                    ...state?.days[dayId]?.categories[categoryName]?.cells || [],
                                    cellName
                                ]
                            }
                        }
                    }
                },
                cells: {
                    ...state?.cells,
                    [cellName]: {
                        ...state?.cells[cellName],
                        category: categoryName,
                        days: [
                            ...state?.cells[cellName]?.days || [],
                            dayId
                        ]
                    }
                }
            }
        }
        case REMOVE_CELL: {
            const { payload } = action
            const { dayId, categoryName, cellName } = payload
            return {
                ...state,
                days: {
                    ...state?.days,
                    [dayId]: {
                        ...state?.days[dayId],
                        categories: {
                            ...state?.days[dayId]?.categories,
                            [categoryName]: {
                                ...state?.days[dayId]?.categories[categoryName],
                                cells: deleteItem(state?.days[dayId]?.categories[categoryName]?.cells, cellName)
                            }
                        }
                    }
                },
                cells: {
                    ...state?.cells,
                    [cellName]: {
                        ...state?.cells[cellName],
                        days: deleteItem(state?.cells[cellName]?.days, dayId)
                    }
                }
            }
        }

        default:
            return state
    }
}
